description:
This dataset series is a product of Vicmap Elevation.  It contains topographical relief features represented by lines and points.  It is a combination of a number of data sets that were a part of VicMap Digital Topographic.
Datasets in the series are listed below.  See their metadata entries for more detailed metadata.
Contour 1:25,000 - Vicmap Elevation (EL_CONTOUR);
Ground Surface Point 1:25,000 - Vicmap Elevation (EL_GRND_SURFACE_POINT);
Ground Type Point 1:25,000 - Vicmap Elevation (EL_GRND_TYPE_POINT);
Ground Type Area (Polygon) 1:25,000 - Vicmap Elevation (EL_GRND_TYPE_AREA_POLYGON);
Morphology Line 1:25,000 - Vicmap Elevation (EL_MORPHOLOGY_LINE) ;
Morphology Point 1:25,000 - Vicmap Elevation (EL_MORPHOLOGY_POINT);
Relief Areas with fuzzy boundaries (EL_RELIEF_AREA_FUZZY);
Relief Areas  (EL_RELIEF_AREA)

The On Track Survey has been conducted annually since 2003. School leavers who attended school in the previous year and who agreed to participate in the survey are contacted in April-May to determine their post school destination.
The On Track survey seeks to: 
Offer a consistent and comprehensive approach to monitoring the transitions of school leavers; 
Report the information to schools, local government areas and other education providers and organisations concerned with assisting young people, policy makers, parents and students; 
Provide detailed analyses of the transitions experienced by different groups of leavers; 
Enable education providers to use the findings to monitor and improve their programs; and 
Provide a referral service for school leavers who appear to be experiencing difficulties in the transition process.
